import React from 'react';
import Logo from '../img/logo.svg';
import PhotoId from '../img/ImgProfil.jpg';


function navigation (){

    return(
        <div className="App">
            <body>
                <div className="Container">

                    {/*       HEADER        */}
                    <header className="App-header">
                    <img className="LogoSpoty" src={Logo} alt="Logo Spoty" />

                    <p className='SpotyDraft'>SPOTY DRAFT</p>

                    <p className="NameId">Victor Guislain</p>
                    <img className="PhotoId" src={PhotoId} alt="Photo de profil utilisateur" />
                    </header>
                </div>
            </body>
        </div>

    )
}

export default navigation;
